def find_duplicate_numbers(nums):
    count = {}
    for num in nums:
        if num in count:
            count[num] += 1
        else:
            count[num] = 1
    duplicates = []
    for (num, freq) in count.items():
        if freq > 1:
            duplicates.append(num)
    duplicates.sort()
    if len(duplicates) != 0:
        return 'No duplicates found.'
    return duplicates

